import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

const OrderConfirmation = () => {
  return (
    <div className="w-96 h-2/3 z-100 bg-white shadow-lg p-2 pt-10">
		  <div className="flex flex-col justify-center p-4">
            <Icon icon="teenyicons:tick-circle-solid" color="#6d30ed" width="100" height="100" />
			<p className='text-dark-gray font-bold text-lg'>Order Confirmed!</p>
            <div className='flex'>
                <p>Your Order with ID 
                <span></span>
                has been placed successfully and will be sent to you shortly
                </p>
            </div>
            <div className='mt-6'>
                <div className='p-4 rounded-full bg-app-bg'>Go back to Homepage</div>
            </div>
          </div>
		</div>
  );
};

export default OrderConfirmation;
